// SPDX-License-Identifier: MIT
pragma solidity ^0.8.1;

contract GetSender {
    function extracFourBytes(string calldata payload) public pure returns(string memory) {
    string memory leading4Bytes = string(payload[:4]);
    return leading4Bytes;
    }
    // 状态变量
    uint[3] public nftName;
    uint[] public dynamicNftName;

    constructor() {
        dynamicNftName = [uint(100), 200, 300];
    }

    function test() public view {
        uint[3] memory nftName1 = [uint(1),2,3];
        uint len1 = nftName1.length;
        uint len2 = dynamicNftName.length;
        require(len2 == 3, "length must be 3");
        require(len1 == 3, 'length must be 3');
        
    }

}

